#define FILELOG   AP_GETENV( 'DOCUMENT_ROOT' ) + AP_GETENV( 'PATH_APP' ) + '/modharbour_samples/text/'


function Main()
  local cText :=  STRTRAN( MemoRead( FILELOG + "document.txt"  ), CHR(34), "'" )
? cText

  TEMPLATE  PARAMS cText
&lt;html&gt;
  &lt;head&gt;
    &lt;meta charset="utf-8"&gt;
    &lt;title&gt;POST example&lt;/title&gt;
  &lt;/head&gt;
  &lt;body&gt;
    &lt;form action="postpairs.prg" method="post" &gt;
      User name:
      &lt;br&gt;
      &lt;input type="text" name="username" value="&lt;?prg return  cText ?&gt;" &gt;
      &lt;br&gt;
      Password:
      &lt;br&gt;
      &lt;input type="password" name="passw"&gt;
      &lt;br&gt;&lt;br&gt;
      &lt;input type="submit" value="Send data"&gt;
    &lt;/form&gt;
  &lt;/body&gt;
&lt;/html&gt;
   ENDTEXT

return nil
